import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MainPageComponent } from './main-page/main-page.component';



@NgModule({
  declarations: [
    MainPageComponent
  ],
  exports: [
    MainPageComponent
  ],
  imports: [
    CommonModule,
    // Evita que se refresque el navegador cada vez que le damos a un botón de submit en un form
    FormsModule
  ]
})
export class DbzModule { }
